SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
SELECT DropGeometryColumn('','states','geom');
DROP TABLE "states";
BEGIN;
CREATE TABLE "states" (gid serial,
"name" varchar(80));
ALTER TABLE "states" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','states','geom','4326','MULTIPOLYGON',2);
CREATE INDEX "states_geom_gist" ON "states" USING GIST ("geom");
COMMIT;
